caption.text:
cheers!
congratulations and good luck on your career as the Regional Chairperson AMSA-Indonesia 2017/2018. quoting from the wise man, "your true success in life begins only when you make the commitment to become excellent at what you do". You had earned what you ask for and now its your turn to become excellent at AMSA-Indonesia.

and also, i would like to give thousands of appreciations to the former executive boards of AMSA-Indonesia:
@anantasiddhi
@erikaindrajaya
@akiltasrif 
@keishadeandrachristie 
@fadiyans 
@sitizktrrhmh 
@edoedwin 
@falensiadwita
@karinajesslyn
@florenceoyen
who had put a lot of dedications, efforts, minds and loves for this organization. great future lies ahead you all! see you when i see you!

viva AMSA!

